  useEffect(() => {
    const response = fetch(
      "https://5d76bf96515d1a0014085cf9.mockapi.io/product"
    )
      .then((res) => res.json())
      .then((resp) => {
        // setData(resp);
      });
  });

  console.log(setData);

  return <section className={classes.Products}>Products</section>;
};

export default Products;
